import React from 'react';
import AppLayout from "../components/AppLayout";
import Head from 'next/head'

const Signup = () => {
  return (<AppLayout>
     <Head>
      <meta charset="utf-8"/>
      <title>signup</title>
    </Head>
    <div>회원가입</div></AppLayout>)
};
export default Signup;
